/* eslint no-unused-vars: 0 */
import { ifDefined } from "lit-html/directives/if-defined.js";
import { html, svg, repeat, classMap, styleMap, unsafeHTML, scopeTag } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';

const main = (context, tags, suffix) => {
	const block0 = (context) => { return html`<tr class="ui5-table-group-row-root" part="group-row" role="row" aria-label=${ifDefined(context.ariaLabelText)} tabindex="${ifDefined(context._tabIndex)}" dir="${ifDefined(context.effectiveDir)}"><td colspan=${ifDefined(context.colSpan)}><slot></slot></td></tr>`; };


	return block0(context);
};

export default main;
